import React from 'react';
import { ListGroupItem } from 'reactstrap';
import {Link} from 'react-router-dom'
import './CityBox.css'

class CityBox extends React.Component {
    constructor(props) { 
        super(props);
        this.state = {
            city: []
        };
    }
    // url1 = () => {
    //     return require(process.env.PUBLIC_URL + this.props.city.image);
    //     "http://localhost:5000/public/images/cities/vienna-austria.jpg"
    // `url(http://localhost:5000/public/images/cities/vienna-austria.jpg)`
    // }
    render() {  
        let asd = (process.env.PUBLIC_URL + this.props.city.image);
        console.log(asd)
        return(
            <div className="CityBox"  >
                <Link to = {{ pathname: "/cities/" + this.props.city._id }}> 
                    <ListGroupItem className="CityBoxList" style={{ backgroundImage: `url(http://localhost:5000/${(process.env.PUBLIC_URL + this.props.city.image)})`
                                                                    }}>
                        <h5>{this.props.city.name}</h5> {}
                    </ListGroupItem> 
                </Link>
            </div>
        )
    }
}

export default CityBox;
